Action.Str:
try {
    url = "http://maps.googleapis.com/maps/api/geocode/json?latlng=" + loc + "&sensor=true";
    http = new XMLHttpRequest();
    http.open("GET", url, false);
    http.send();
    if (http.status == 200) {
        json = eval("( " + http.responseText + ")");
        if (json.status == "OK" && json.results && json.results.length > 0) {
            addr = json.results[0].formatted_address;
        }
        else {
          addr = "ERROR! " + json.status;
        }
    }
    else {
      addr = "ERROR! " + http.status + " " + http.statusText;
    }
}
catch(e) {
  addr = "ERROR! " + url;
}
